import React from "react";
import { Card, CardHeader, CardMedia, withStyles } from "@material-ui/core";
import { grey, blueGrey } from "@material-ui/core/colors";

import discMania from "../../../images/discmania.png";

const styles = {
  card: {
    width: 175,
    height: 250,
    backgroundColor: grey[300]
  },
  header: {
    height: 25
  },
  mediaContainer: {
    height: "100%",
    width: "100%"
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Card className={classes.card}>
      <CardMedia
        title="DiscMania Logo"
        src={discMania}
        className={classes.mediaContainer}
      >
        <CardHeader title="DD3" className={classes.header} />
      </CardMedia>
    </Card>
  );
});
